import React from "react";

function HelloDiv() {
  return (
    <div>
  <h1>Hello! My name is Tyler Hill</h1>
  <h3>Things that I like:</h3>
  <li>
    <ul>Cheese</ul>
    <ul>Tennis</ul>
    <ul>Music</ul>
  </li>
  </div>
  );
}

export default HelloDiv;
